import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Form.scss';
import Navbar from './../Navbar/Navbar';
import useSignup from './../../hooks/useSignup';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const SignupPage = () => {
  const { signup, isLoading, error, success } = useSignup();

  const [FormData, setFormData] = useState({
    name: '',
    email: '',
    username: '',
    password: '',
    bio: '',
    skills: '',
    interests: '',
    location: '',
  });

  const handleInput = (e) => {
    const { name, value } = e.target;
    setFormData({ ...FormData, [name]: value });
  };

  const RegisterUser = async (e) => {
    e.preventDefault();
    const { name, email, username, password, bio, skills, interests, location } = FormData;
    
    // Convert skills and interests from strings to arrays
    const skillsArray = skills.split(',').map(skill => skill.trim());
    const interestsArray = interests.split(',').map(interest => interest.trim());

    await signup(name, email, username, password, bio, skillsArray, interestsArray, location);
  };

  const toastProperty = () => ({
    position: 'top-right',
    autoClose: 5000,
    hideProgressBar: false,
    closeOnClick: true,
    pauseOnHover: true,
    draggable: true,
    progress: undefined,
    theme: 'colored',
  });

  return (
    <>
      {/* Adding Navbar to the page */}
      <Navbar isLogin="false" />

      {/* Adding react-toastify to the page */}
      <ToastContainer />

      {/* Showing error message to user */}
      {error && toast.error(error, toastProperty())}
      
      {/* Showing success message to user */}
      {success && toast.success(success, toastProperty())}

      <div className="form-body">
        <div className="form-box">
          <div className="form-header">
            <h3>Sign up</h3>
          </div>
          <div className="form-inner-body">
            <form method="post" onSubmit={RegisterUser}>
              <div className="input-group">
                <input value={FormData.name} onChange={handleInput} type="text" placeholder="Name" name="name" id="name" />
                <label htmlFor="name">Name</label>
              </div>
              <div className="input-group">
                <input value={FormData.username} onChange={handleInput} type="text" placeholder="Username" name="username" id="username" />
                <label htmlFor="username">Username</label>
              </div>
              <div className="input-group">
                <input value={FormData.email} onChange={handleInput} type="email" placeholder="Email" name="email" id="email" />
                <label htmlFor="email">Email</label>
              </div>
              <div className="input-group">
                <input value={FormData.password} onChange={handleInput} type="password" placeholder="Password" name="password" id="password" />
                <label htmlFor="password">Password</label>
              </div>
              <div className="input-group">
                <textarea value={FormData.bio} onChange={handleInput} placeholder="Bio" name="bio" id="bio"></textarea>
                <label htmlFor="bio">Bio</label>
              </div>
              <div className="input-group">
                <input value={FormData.skills} onChange={handleInput} type="text" placeholder="Skills (comma separated)" name="skills" id="skills" />
                <label htmlFor="skills">Skills</label>
              </div>
              <div className="input-group">
                <input value={FormData.interests} onChange={handleInput} type="text" placeholder="Interests (comma separated)" name="interests" id="interests" />
                <label htmlFor="interests">Interests</label>
              </div>
              <div className="input-group">
                <input value={FormData.location} onChange={handleInput} type="text" placeholder="Location" name="location" id="location" />
                <label htmlFor="location">Location</label>
              </div>
              <div className="input-group">
                <input type="checkbox" name="term" id="term" />
                <label htmlFor="term" className="checkbox">
                  I agree with terms & conditions
                </label>
              </div>
              <div className="input-group">
                <button className="btn" type="submit" disabled={isLoading}>Submit</button>
              </div>
            </form>
            <p>Already have an account? <Link to="/login">Sign in</Link></p>
          </div>
        </div>
      </div>
    </>
  );
};

export default SignupPage;
